import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import ProjectCard from "./ProjectCards";
import Particle from "../Particle";
import "../../style.css";
import "bootstrap/dist/css/bootstrap.min.css";

import leaf from "../../Assets/Projects/leaf.png";
import emotion from "../../Assets/Projects/emotion.jpeg";
import medhub from "../../Assets/Projects/medHub.png";
import eeg from "../../Assets/Projects/eeg.gif";
import suicide from "../../Assets/Projects/suicide.png";
import algo from "../../Assets/Projects/algo.png";
import plant from "../../Assets/Projects/plant.jpeg";

function Projects() {
  return (
    <Container fluid className="project-section">
      <Container>
        <h1 className="project-heading">
          My Recent <strong className="purple">Works </strong>
        </h1>
        <p style={{ color: "white" }}>
          Here are a few projects I've worked on recently.
        </p>
        <Row style={{ justifyContent: "center", paddingBottom: "10px" }}>
          <Col md={4} className="project-card">
            <ProjectCard
              imgPath={leaf}
              isBlog={false}
              title="Color Switch Game"
              description="Implemented a version of the famous game color switch using JavaFX and Java."
              link="https://github.com/kumarajay0412/Color-switch-game"
            />
          </Col>

          <Col md={4} className="project-card">
            <ProjectCard
              imgPath={emotion}
              isBlog={false}
              title="Trshna"
              description="IoT device that connects to the water supply in your house and tracks water usage of different members in the house."
              link="https://sites.google.com/iiitd.ac.in/trsna/home?authuser=1"
            />
          </Col>

          <Col md={4} className="project-card">
            <ProjectCard
              imgPath={suicide}
              isBlog={false}
              title="Covid-19 india tracker"
              description="A web app for getting the covid patient in your locality based on your location IT using google API in react.
              "
              link="http://kumarajay0412.github.io/deploy/"
            />
          </Col>

          <Col md={4} className="project-card">
            <ProjectCard
              imgPath={eeg}
              isBlog={false}
              title="Boogeyman"
              description="Developed a game made on processing enviorment
              and using aurdino technology it was human interaction game which used many kind of sensors which gives input to control game movements"
              link="https://www.youtube.com/watch?v=MfDflAk9dPw&feature=youtu.be&ab_channel=AjayKumar"
            />
          </Col>

          <Col md={4} className="project-card">
            <ProjectCard
              imgPath={medhub}
              isBlog={false}
              title="Making Healthcare Easy and Hassle Free"
              description="Extract, store and retrieve medical information from Medical Reports using OCR.
              Display the information online Graphically for the use of Patients as well as Doctors only with Authorised Access.
              Giving an complete health Analytics to doctors of Patients as well as Doctors preseving user privacy."
              link="https://github.com/soumyajit4419/MedHub_360"
            />
          </Col>
        </Row>
        </Container>
    </Container>
  );
}

export default Projects;
